// File: frontend/hooks/useGameAudio.ts
import { useState, useEffect, useRef, useCallback } from 'react';

// Vui lòng Dán mã Base64 của bạn vào đây (chỉ dùng cho mục đích debug)
const BASE64_SPIN_SOUND = "data:audio/mp3;base64,"; 
const BASE64_WIN_SOUND = "data:audio/mp3;base64,"; 


interface GameAudioControls {
  toggleMute: () => void;
  isMuted: boolean;
  playSpin: () => void;
  stopSpin: () => void;
  playWin: () => void;
}

// Chuyển Hook thành không tham số để tránh lỗi Type Error
export const useGameAudio = (): GameAudioControls => {
  const [isMuted, setIsMuted] = useState(false);
  const spinAudio = useRef<HTMLAudioElement | null>(null);
  const winAudio = useRef<HTMLAudioElement | null>(null);
  
  // Khởi tạo Audio Objects (Chỉ chạy 1 lần)
  useEffect(() => {
    const sAudio = new Audio(BASE64_SPIN_SOUND); 
    sAudio.loop = true;
    sAudio.volume = 0.8;
    sAudio.muted = isMuted;
    spinAudio.current = sAudio;

    const wAudio = new Audio(BASE64_WIN_SOUND); 
    wAudio.volume = 1.0;
    wAudio.muted = isMuted;
    winAudio.current = wAudio;

    return () => {
      sAudio.pause();
      wAudio.pause();
    };
  }, [isMuted]); // Thêm isMuted vào dependency để đảm bảo khởi tạo đúng

  
  // Hàm Play/Stop trực tiếp
  const playSpin = useCallback(() => {
    if (isMuted) return;
    winAudio.current?.pause();
    spinAudio.current?.play().catch(e => console.log("Play Spin Blocked:", e));
  }, [isMuted]);

  const stopSpin = useCallback(() => {
    spinAudio.current?.pause();
  }, []);

  const playWin = useCallback(() => {
    if (isMuted) return;
    spinAudio.current?.pause();
    if (winAudio.current) {
        winAudio.current.currentTime = 0;
        winAudio.current.play().catch(e => console.log("Play Win Blocked:", e));
    }
  }, [isMuted]);
  
  // Logic 3: Quản lý Mute/Unmute
  const toggleMute = useCallback(() => {
    setIsMuted(prev => {
      const newState = !prev;
      
      if (spinAudio.current) spinAudio.current.muted = newState;
      if (winAudio.current) winAudio.current.muted = newState;

      return newState;
    });
  }, []);

  return { toggleMute, isMuted, playSpin, stopSpin, playWin };
};
